【標準組立】は、物置工事をする場合に必ず必要なものです。物置の機種によって価格が違います。<br /> １．屋外で1階地上面であることを確認します <br /> ※地面がコンクリートやアスファルトの場合は、別途【傾斜調整】が必要になることがあります<br /> 
<font color='red'>注意：屋内、ベランダ、屋上などの地上面以外の設置は安全上お受けできません</font><br />２．ブロックを設置<br /> ３．ブロック上を水平にします。（この作業が一番大切で難しい作業です）<br /> ４．部品を組み上げていきます。<br />  地面との固定は致しませんので、屋外に設置する場合は必ず転倒防止工事をすることをお勧めします。 春一番や台風などの風に対し、倒れにくくなります。<br />  <font color="red">※工事のみのご提供はおこなっておりません。<br /> 　必ずキロの商品とあわせてご購入をお願いいたします。</font> <br /><font color='red'>※商品の寸法不足・色間違い等による返品・キャンセルはお受けできません。設置場所・商品の寸法、商品詳細をよくご確認の上ご注文頂きますようお願い致します。<br />※商品、職人の搬入経路に一定のスペースが無い場合や設置場所の状況によっては工事対応致しかねる場合がございます。「組立工事について」をよくご確認下さい。</font><!--左追いかけバナー セール用-->

<!--　セール左追いかけバナー　ここまで　-->

