物置を設置する場合に一番大切なのは地面に傾斜が無いことが重要です。<br />物置などの工業製品は地面が水平で無い場所で設置するとビス穴や扉などがうまく合わなくなり設置ができない、鍵が閉まらないなどの問題が発生します。<br />土の場合、簡単に削ることができ傾斜を水平にすることができるのですが<br />コンクリートやアスファルトなど土と違って安易に傾斜を調整できない場合は、モルタル（セメントと水と砂を合わせたもの）をブロックの下に敷き調整をします。<br />調整できる高さは3センチくらいです。それ以上の場合はブロックなどの高さも変えてモルタルで調整しますので一度ご相談ください。<br /><font color='red'>
※商品の寸法不足・色間違い等による返品・キャンセルはお受けできません。設置場所・商品の寸法、商品詳細をよくご確認の上ご注文頂きますようお願い致します。<br />
